var jsonData = JSON.parse(stringData);
var skinSelectBox = document.getElementById('skin');

var previews = new Map();

for (var i = 0; i < jsonData.skins.length; i++)
{
    var skin = jsonData.skins[i];
    var option = document.createElement('option');
    option.value = skin.alphabeticalId;
    option.innerHTML = skin.presentationName;
    skinSelectBox.appendChild(option);

    previews.set(skin.alphabeticalId, skin.lowResPreview);
}

var imageSkinPreview = document.getElementById('imageSkinPreview');
var modalSkinPreview = document.getElementById('modalSkinPreview');

imageSkinPreview.src = previews.get(Number(skinSelectBox.value));

skinSelectBox.addEventListener('change', function() {
    var key = Number(this.value);
    if (previews.has(key)) {
        imageSkinPreview.src = previews.get(key);
    }
});

